import React from 'react';
import Input from './input';
import sidebarNav from './sidebarNavigation';

export default class sidebarSecondary extends React.Component {
    render() {
        return (
            <li>
                <SecondaryNavItems />
            </li>
        )
    }
}

function SecondaryNavItems() {  
    return sidebarNav.map((item) => <Input name={item.dropdown}/>)
}
